INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1001, 1, 1.4, 1, 0, "お！\nあそこに困ってそうな人発見！", 0, "春咲 ひより", 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1002, 1, 1.4, 1, 0, "大切な人を\n守れるようになりたい…って", 0, "草野 優衣", 2, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1003, 1, 1.4, 1, 0, "キミに必要な集中力と感性が", 0, "士条 怜", 2, "フェンシングを始めてみては？", 0, 1, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1004, 1, 1.5, 1, 0, "今日はなにして遊ぶ？", 0, "穂高 みそぎ", 2, "ねぇ、にいちゃん！", 0, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1006, 1, 1.4, 1, 0, "ねぇ…", 0, "風宮 あかり", 2, "風宮あかりです", 0, 1, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1007, 1, 1.5, 1, 0, "プリンたべたいのー", 0, "出雲 宮子", 2, "出雲宮子なのー", 0, 1, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1008, 1, 1.4, 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "虹村 雪", 2, "ボクは虹村雪。", 0, 1, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1009, 1, 1.4, 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "柊杏奈", 2, "フッ…聞いて後悔するがいい！", 0, 1, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1010, 1, 1.5, 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "姫宮 真歩", 2, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1011, 1, 1.4, 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲 璃乃", 2, "衣之咲璃乃です！", 0, 1, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1012, 1, 1.4, 1, 0, "ち、超能力って…\n何のことかな～？", 0, "柏崎 初音", 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1016, 1, 1.4, 1, 0, "一応カリスマ読モJKやってまっす！", 0, "美波 鈴奈", 2, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1017, 1, 1.4, 1, 0, "東京は遊園地みたいなところさー", 0, "喜屋武 香織", 2, "はいたーい。\n喜屋武香織さー。", 0, 1, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1018, 1, 1.4, 1, 0, "先生って呼ばれるのは\nくすぐったいから", 0, "支倉 伊緒", 2, "支倉伊緒です。", 0, 1, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1020, 1, 1.5, 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "茜 ミミ", 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1021, 1, 1.5, 1, 0, "あの……\nふぇ……", 0, "栗林 くるみ", 2, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1022, 1, 1.4, 1, 0, "こんな私に貴重な時間を\n割いていただき、", 0, "風宮 より", 2, "風宮よりです。\nあああああ！", 0, 1, 0, "なんてありがとうございます！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1023, 1, 1.5, 1, 0, "おにいちゃんどこいくの？\nえ？", 0, "北条 綾音", 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1025, 1, 1.4, 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "天野 すずめ", 2, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1027, 1, 1.4, 1, 0, "あなたは…運命の……\n伴侶……", 0, "倉石 恵理子", 2, "……クスクス…私は\n…倉石恵理子……", 0, 1, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1028, 1, 1.4, 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木 咲恋", 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 0, "…そうでしょ？？");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1029, 1, 1.4, 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井 望", 2, "桜井望だよ！\nよろしくねっ", 0, 1, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1030, 1, 1.4, 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ニノン・ジュベール", 2, "デケデケデンっ！", 0, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1031, 1, 1.4, 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜 しのぶ", 2, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 0, "おかしいですね……");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1033, 1, 1.5, 1, 0, "けんども\nそれには足りないモンが…", 0, "野戸まひる", 2, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1034, 1, 1.4, 1, 0, "ちょっと緊張しちゃって…", 0, "綾瀬 ゆかり", 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1036, 1, 1.5, 1, 0, "知らない人とは話しちゃいけないので", 0, "氷川 鏡華", 2, "氷川鏡華…です", 0, 1, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1038, 1, 1.4, 1, 0, "……あ、アラーム。", 0, "柏崎 栞", 2, "柏崎…栞です。", 0, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1040, 1, 1.4, 1, 0, "私、一人も友達がいなくて……", 0, "双葉 碧", 2, "ふ、双葉碧です。", 0, 1, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1042, 1, 1.4, 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角 千歌", 2, "三角千歌です。", 0, 1, 0, "そう思っています。");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1043, 1, 1.4, 1, 0, "あぁ？\nお前のそいつの仲間か？", 0, "安芸 真琴", 2, "安芸真琴だ。", 0, 1, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1044, 1, 1.4, 1, 0, "生けとし生ける全ての者よ！", 0, "イリヤ・オーンスタイン", 2, "わらわこそは夜を総べる者！", 0, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1045, 1, 1.4, 1, 0, "ぐふふふふ……はっ！", 0, "遠見 空花", 2, "そこで騎士は妖精を乱暴に……", 0, 1, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1046, 1, 1.4, 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまき", 2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1048, 1, 1.4, 1, 0, "それでは早速クエストに…", 0, "大神 美冬", 2, "大神美冬よ！", 0, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1049, 1, 1.4, 1, 0, "クエストもバトルも\n掃除も洗濯も", 0, "星野静流", 2, "星野静流だよ！", 0, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1050, 1, 1.5, 1, 0, "見ての通りの\nセクシー美少女で", 0, "玉泉美咲", 2, "アタシは玉泉美咲。", 0, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1052, 1, 1.4, 1, 0, "？？？？", 0, "リマ", 2, "？？？", 0, 1, 0, "？？？？");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1053, 1, 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, "モニカ・ヴァイスヴィント", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1058, 1, 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, "ペコリーヌ", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1059, 1, 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, "コッコロ", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 1060, 1, 1.5, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, "キャル", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, "そ、そこまでいうなら\nもらってやる");
